Arquitetura de desenvolvimento de sistemas .NET 2.0 e Mono sobre o modelo MVC

- Controles de desenvolvimento;
- Conexão unificada com bnco de dados;
- GenericDao para camada de persistência;
- GenericController para camada controller do MVC;

Solução para rastreamento de dispositivos móveis composta por:
- Uma Aplicação ASP.NET;
- Um Web Service;
- Uma Aplicação utilizando o plugin Xamarin.
